import React from 'react';

const ReadOnlyRow = ({ review }) =>
{
    return(
        <tr key={review.commentId}>
            <td>{review.rating === 1 ? '1 Start' : review.rating + ' Stars'}</td>
            <td>{review.review}</td>
        </tr>
    )
}

export default ReadOnlyRow;
